import { Component } from "react"

export default class RobotInGame extends Component() {
    status = {
        x: 20,
        y: 20
    }
    style = {
        width: this.status.x,
        height: this.status.y,
        position: "absolute",
        top: "100px",
        left: "100px",
        backgroundColor: "red"
    }
    render() {
        return (<div style={this.style}></div>);
    }
}
